int gcd(int a, int b){ return b? gcd(b, (a%b)): a; }
const int N = 200010;
ll quic_pow(ll a, ll b){ll res = 1;	while(b){if( b&1) res = res * a;		a = a * a;		b >>= 1;	}	return res;}
int n,m;
int p[N];
void solve(){
	cin >> m;
	int mn = 1e9+10;
	int mx = 0;
	for(int i = 0; i <= m; i++){
		cin >> p[i];
		mn = min(mn,p[i]);
		mx = max(mn,p[i]);
	}
	if(mn>=5e8) cout << 0 << ' ' << 1 <<endl;
	else if(mx<=5e8) cout << 1000000000 << ' ' << 1000000000-1 << endl;
	else cout << 0 << ' ' << 1000000000 << endl;


}

int main(){
	INIT;
	int _ = 1;
	//cin >> _;
	while(_--){
		solve();
	}

}

